webpackJsonp([0xaaa78bd20470],{379:function(a,e){a.exports={data:{markdownRemark:{html:'<h2><a href="http://shefalinayak.com/visualquizzing/app/">Link to the project demo</a></h2>\n<p>Visual Quizzing is a new approach to online quizzing modules used by the Princeton Computer Science Department. The questions are from a course about algorithms and data structures. The existing question format is largely text-based and not particularly intuitive, often leading to unnecessary errors, especially since there isn\'t a good way to discuss these questions online.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 41.56820622986036%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="old question module"\n        title=""\n        src="/static/question-67353132131ad31e6181c60844c97618-f8a33.png"\n        srcset="/static/question-67353132131ad31e6181c60844c97618-9609f.png 148w,\n/static/question-67353132131ad31e6181c60844c97618-62aa1.png 295w,\n/static/question-67353132131ad31e6181c60844c97618-f8a33.png 590w,\n/static/question-67353132131ad31e6181c60844c97618-4bd07.png 885w,\n/static/question-67353132131ad31e6181c60844c97618-39a89.png 1180w,\n/static/question-67353132131ad31e6181c60844c97618-7f179.png 1770w,\n/static/question-67353132131ad31e6181c60844c97618-bdc5d.png 1862w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 87.73584905660377%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="online discussion of a question"\n        title=""\n        src="/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-f8a33.png"\n        srcset="/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-9609f.png 148w,\n/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-62aa1.png 295w,\n/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-f8a33.png 590w,\n/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-4bd07.png 885w,\n/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-39a89.png 1180w,\n/static/piazza-454f0cc4e9327e9e428a8b65cf1313f7-23ff4.png 1484w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>\n<p> The new visual and interactive versions of some question modules are an opportunity to help students practice and really understand hierarchical data structures. The modules can also be used during classes or lectures to explain the algorithms.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 73.86091127098321%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="new question module"\n        title=""\n        src="/static/final-304d49b5d782ab67fe8cdbf85d99f18f-f8a33.png"\n        srcset="/static/final-304d49b5d782ab67fe8cdbf85d99f18f-9609f.png 148w,\n/static/final-304d49b5d782ab67fe8cdbf85d99f18f-62aa1.png 295w,\n/static/final-304d49b5d782ab67fe8cdbf85d99f18f-f8a33.png 590w,\n/static/final-304d49b5d782ab67fe8cdbf85d99f18f-4bd07.png 885w,\n/static/final-304d49b5d782ab67fe8cdbf85d99f18f-39a89.png 1180w,\n/static/final-304d49b5d782ab67fe8cdbf85d99f18f-938ec.png 1668w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  </p>',frontmatter:{title:"Visual Quizzing"}}},pathContext:{slug:"/pages/projects/visual-quizzing/post/"}}}});
